(function(document) {
    chrome.storage.local.get("isEnabled", function(items) {
        if ((window.location.href.indexOf('web.facebook.com') > -1 || window.location.href.indexOf('www.facebook.com') > -1) && !items.isEnabled) {
            chrome.storage.local.get('urls', function(url) {
                if (chrome.runtime.lastError) {
                    return;
                }
                if (url.urls) {
                    var keywords = [];
                    keywords = getAddressFromData(url.urls);
                    if (!!keywords) {
                        var regEx = new RegExp(keywords.join("|"), "i");
                        var fblooper = setInterval(function() {
                            var elements = document.getElementsByClassName('userContent');
                            for (var i = 0; i < elements.length; i++) {
                                var directSharedLink = hasDirectSharedLink(elements[i], regEx);
                                var secondShared = hasSecondSharedLink(elements[i], regEx);
                                if (directSharedLink.status) {
                                    if (directSharedLink.withPrev) {
                                        putBlocker(elements[i].nextElementSibling, i, 'direct', 'with-preview');
                                    } else {
                                        putBlocker(elements[i].nextElementSibling, i, 'direct', 'without-preview');
                                    }
                                } else if (secondShared.status) {
                                    if (secondShared.withPrev) {
                                        putBlocker(elements[i].nextElementSibling, i, 'second', 'with-preview');
                                    } else {
                                        putBlocker(elements[i].nextElementSibling, i, 'second', 'without-preview');
                                    }
                                }
                            }
                        }, 5000);
                    }
                }
            })
            if (chrome.runtime.lastError) {
                return;
            }
        }
    });
})(document);

function putBlocker(element, i, direct, type) {
    if (element.parentElement.className.indexOf('modified') < 0) {
        element.parentElement.className += ' modified';
        element.setAttribute('id', 'userContent_' + i);
        element.style.position = 'relative';
        var height = element.clientHeight;
        if (direct == 'direct') {
            if (type == 'without-preview') {
                chrome.runtime.sendMessage({
                    action: "article-found",
                    title: "Direct Shared Article w/out Preview"
                });
                element.insertBefore(blockerWithoutPreview(i, height), element.firstElementChild);
            } else {
                chrome.runtime.sendMessage({
                    action: "article-found",
                    title: "Direct Shared Article w/ Preview"
                });
                if (height < 200) {
                    element.insertBefore(blockerWithoutPreview(i, height), element.firstElementChild);
                } else {
                    element.insertBefore(divBlocker(i, height), element.firstElementChild);
                }
            }
        } else if (direct == 'second') {
            if (type == 'without-preview') {
                chrome.runtime.sendMessage({
                    action: "article-found",
                    title: "Second Shared Article w/out Preview"
                });
                element.insertBefore(blockerWithoutPreviewSecond(i, height), element.firstElementChild);
            } else {
                chrome.runtime.sendMessage({
                    action: "article-found",
                    title: "Second Shared Article w/ Preview"
                });
                element.insertBefore(divBlocker(i, height), element.firstElementChild);
            }
        }
    }
}

function hasDirectSharedLink(element, regEx) {
    var result = {
        'status': false,
        'withPrev': false
    };
    var sibling = element.nextElementSibling;
    var child;
    var anchors = sibling.getElementsByTagName('a');
    for (var i = 0; i < anchors.length; i++) {
        result.status = regEx.test(anchors[i].href);
        result.withPrev = !!anchors[i].firstElementChild;
        return result;
    }
    return result;
}

function hasSecondSharedLink(element, regEx) {
    var result = {
        'status': false,
        'withPrev': false
    };
    var sibling = element.nextElementSibling;
    var child;
    var divWithPrev = sibling.getElementsByClassName('_6ks');
    if (!!divWithPrev.length) { 
        var anchors = divWithPrev[0].getElementsByTagName('a');
        for (var x = 0; x < anchors.length; x++) {
            result.status = regEx.test(anchors[x].href);
            result.withPrev = true;
            return result;
        }
    } else { 
        var anchors = sibling.getElementsByClassName('_52c6');
        for (var i = 0; i < anchors.length; i++) {
            result.status = regEx.test(anchors[i].href);
            result.withPrev = false;
            return result;
        }
    }
    return result;
}

function containsDirect(words) {
    var regEx = new RegExp(words.join("|"), "i");
    var elements = document.getElementsByTagName('*');
    var textType = 3;
    var found = false;
    for (var ctr = 0; ctr < elements.length; ctr++) {
        var element = elements[ctr];
        for (var i = 0; i < element.childNodes.length; i++) {
            var node = element.childNodes[i];
            if (node.nodeType === textType) {
                var text = node.nodeValue;
                if (regEx.test(text)) {
                    found = regEx.test(text);
                    return found
                }
            }
        }
    }
    return found;
}

function getAddressFromData(data) {
    return data.map(function(obj) {
        return obj.address;
    });
}